지만 여긴 어림잡아 200마리? 머 다 세어보진 못해서ㅠ 정말 많이 있었습니다. 코로나때문에 사람들이 별로 없을꺼라 생각했는데 사람들 정말 많았지만  방역수칙도 준수하고 있고음식물 섭취(음료포함)도 통제하고 있어서 그나마 안전해 보였습니다.고양이를 좋아하는 분들이라면 데이트코스로 추천합니다.',4,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/a2488c05-e8ac-4a7b-a89e-a2f0d101b2a42022-03-31%20%282%29.jpg',179,34),(737,'2022-04-04 13:11:40','2022-04-04 13:11:40','조용하고 행복한 기분..힐링하러 한번씩 갑니다',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/f786a8b1-d423-4bc9-9b7e-1b4994cbd0522022-03-31%20%283%29.jpg',179,35),(738,'2022-04-04 13:12:05','2022-04-04 13:12:05','옛날식당하던 집 고양이 정원 현대\n생활에 적합하다 할까요  요즈음 은\n고양이와 개가 대세네요 남녀 노소\n어린이 까지 많이 모였네요 고양이\n를 아끼고 사랑하는 모임이  아닐까\n하네요 멋지네요',4,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/0b211e8c-6123-48c5-a6b5-f6247aa16bf22022-03-31%20%2810%29.jpg',179,36),(739,'2022-04-04 13:12:25','2022-04-04 13:12:25','양이를 좋아하는 아이들의 천국\n개냥이가 이런것이구나 느끼게 해주는 이쁜 양이들 잔뜩 있는곳',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/dbbd6bfb-317f-4775-8a5e-2cb8815833142022-03-31%20%287%29.jpg',179,37),(740,'2022-04-04 13:12:49','2022-04-04 13:12:49','다양한 종류의 고양이 수십마리가 모여 있어요 위쪽 정원에 돗자리 펴고 누워 있으면 담요 쪽으로 고양이들이 알아서 옵니다ㅎㅎ 손을 많이 타서 궁디팡팡 좋아하는 고양이도 있고 등긁어주는 거 좋아하는 고양이도 있습니다',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/1a57abd2-df2e-4da1-a87e-d24722e888162022-03-31%20%288%29.jpg',179,38),(741,'2022-04-04 13:13:28','2022-04-04 13:13:28','코로나로 음료를 마실 수 없는 카페입니다. 나갈 때 파는 음료수 중에 하나 골라서 나가는 시스템으로  고양이를 좋아하시는 분들에게만 추천합니다.\n두 시간 체류가능하며 실내에 앉으려면 서두르셔야 합니다. 가성비를 따지는 곳이 아닙니다.',3,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/5543e955-8935-4d4c-a0d1-18247cc2f92b2022-03-31.jpg',179,39),(742,'2022-04-04 13:16:33','2022-04-04 13:16:33','한번 들러보기 좋은 곳입니다.\n해외같이 거대하고 넓게 꾸며놓은 곳이기 보다는 아기자기하게 이것저것 꾸며놓은 곳입니다.\n주말이나 공휴일에는 사람이 많아서 사진찍기 좀 불편합니다.',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/4aa0101d-2a30-4a35-b510-63efe63788f220220129_115627.jpg',180,1),(743,'2022-04-04 13:17:04','2022-04-04 13:17:04','볼거리도 많고 잘꾸며 놔서 괜찮은곳\n완전 더울줄알았는데 그렇게 막 안덥고 딱 관람하고 돌아다니기 좋은 온도였다.\n\n애기들이랑 와서 구경하기 나쁘지\n않음 애기들이 볼만한게 많음 그리고 사람들도 완전 많지 않았음 토요일에 갔다왔는데\n\n야외에서도 볼만한것도 많고\n\n근데 완전 내부가 클줄알았지만 그게 아니라 조금 당황했지만 그래도 서울에서 이렇게\n자연을 가득 담고있는 곳이라 한번쯤은 가서 보고 즐길만함\n\n관람료 성인5,000원임 참고하세요',4,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/23c72e75-62d8-463e-8c91-9d355d24397bimages.jpg',180,40),(744,'2022-04-04 13:17:27','2022-04-04 13:17:27','겨울이라 온실만 방문함.\n1층 입구 옆, 2층에 라카있습니다. 4시간에 1000원, 젤 작은칸 금액이고, 지하철거랑 똑같아요.\n더워서 겉옷 무조건 벗고 들어가는거 추천합니다.\n온실 안에 볼 거 많았어요!',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/e7dec4e7-34d4-4a68-b0a0-22093925a432%EB%8B%A4%EC%9A%B4%EB%A1%9C%EB%93%9C%20%281%29.jpg',152,1),(745,'2022-04-04 13:17:56','2022-04-04 13:17:56','외국 어디어디 유명한 식물원에 비하면 좀 부족한 듯 하지만 그래도 우리나라에서 이게 어디야 싶음. 두꺼운 옷 껴입고 한겨울에 방문했는데 온실이라 그런지 당연하게도 습도도 높고 온도도 따뜻해서 나중엔 살짝 더웠네요 땀도 나구요. 입장 전 락커룸에 옷 맡기고 가시면 조금 편할 듯 합니다. 꽃 많이 필때 한번 더 갔으면 좋겠네요.',4,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/ef3969e8-b85e-46a0-8287-d074d50c0d78%EB%8B%A4%EC%9A%B4%EB%A1%9C%EB%93%9C.jpg',180,1),(746,'2022-04-04 13:19:50','2022-04-04 13:19:50','옥토넛 좋아하는 애들은 필히!!!!오래된 곳이라 상어수족관의 크기가 작았지만 상어들이 엄~청 커요!!!\n아쿠아리움 여기저기 다녀봤지만 젤 큰 느낌이네요~\n옥토넛 대원들과 탐험선들이 여기저기 아기자기하게 많아서 애들이 너무 좋아했어요~',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/288ab8c2-463d-4a03-8b6b-84edec907d3d2022-02-23.jpg',181,1),(747,'2022-04-04 13:20:12','2022-04-04 13:20:12','아주 오랫만에 친구와 평일 오전에 다녀왔습니다.\n사람적고 쾌적한 분위기에서 관람할 수 있었어요.\n예매티켓은 미리 네이버를 통해 할인적용 받을 수 있었고요.\n코엑스몰이 워낙 넓다보니 2호선 지하철에서 나와 아쿠아리움까지 최소15분은 걸어야하는 점 감안하셔서 약속시간을 잡으시면 좋겠습니다.',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/d335fe76-1e08-4c3f-89ba-8c4d4908d68a2022-02-23%20%282%29.jpg',181,41),(748,'2022-04-04 13:20:44','2022-04-04 13:20:44','옥토넛을 좋아하는 아이에게 바다 생물을 같이 보며 파나클, 콰지, 페이소 이야기를 같이 나누는 경험을 할 수 있어서 좋았습니다.\n아쉬운 점 한가지는 유모차 동선입니다. 아쿠아리움 포함 주차장부터 코엑스는 유모차나 휠체어 동선이 아쉬움이 많습니다.',4,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/7da72a1c-e1ec-4e06-938f-0d16cad4950c2021-06-05.jpg',181,42),(749,'2022-04-04 13:21:10','2022-04-04 13:21:10','수달 냄새가 멀리서부터 나기 시작하고\n냄새에 예민한 사람은 멀미날 수 있음. 아쿠아리움은 어디나 비슷한 듯 함.\n\n눈높이가 아이들에게 맞추어져 있어 아이가 매우 좋아함.\n매표소에 물어보면 가장 저렴한 방법을 친절하게 안내해 줌.',3,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/3703989b-578f-4640-9c81-7f292894de922022-02-23%20%281%29.jpg',181,43),(750,'2022-04-04 13:21:33','2022-04-04 13:21:33','강남 한가운데에서 아쿠아리움에 오니 시원하고 색다른 느낌이었다. 스타필드 화려함도 구경하고 가지각색, 다양한 물고기들이 있어서 볼거리가 많았다. 해저터널을 통과할 때는 내가 바다 속에 있는 느낌이었다. 상어와 메너티도 보았고 육지거북과 바다거북의 다른 점도 알 수 있었다. ',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/04e1b53a-dd01-455d-bf57-2998c33f057c2022-02-07.jpg',181,44),(751,'2022-04-04 13:23:01','2022-04-04 13:23:01','하늘공원 옆에 있는 쌍둥이 느낌의 공원이죠\n하지만 생태공원 느낌의 하늘공원과는  달리  잔디가 쫙~ 깔려있고  곳곳에 화장실 캠핑장 골프장 등이 있고 조형물이 많네요 둘중에 어디 갈거냐고 묻는다면 당연 노을 공원을 선택할겁니다 노을이 이뻐서 노을공원 이라고 했다죠',4,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/0ef60d18-ce09-4369-9406-3102c34e56912021-11-28.jpg',182,1),(752,'2022-04-04 13:24:21','2022-04-04 13:24:21','서울에 이토록 넋을 잃고 황홀하게 만들 곳이 또 어디있을지? 공원 이름처럼 해질녘 즈음 산책하면 천국이 따로 없는 곳이다. 골프장을 만드려다 용도를 변경하여 정원과 캠프장, 조각들을 설치해놓은 훌륭한 곳이다. 등산로도 험하지 않으니 서울에서 꼭 가봐야 할 곳이다.',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/eec66d2c-fded-4e6c-b993-4c69e807348b%EB%85%B8%EC%9D%84%EA%B3%B5%EC%9B%901.PNG',182,45),(753,'2022-04-04 13:25:54','2022-04-04 13:25:54','깔끔하게 잘 조성된 공원, 메타스퀘어길과 공원 위에서 높은 하늘의 경치를 보니 맘이 확 터지는 듯, 노을공원 캠핑장에 사람들도 있고 서울에 이런 곳이 있을줄을 몰랐었네요',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/c4dc4eb6-57aa-4063-9184-3bc3ab3d3c282021-07-19.jpg',182,46),(754,'2022-04-04 13:35:20','2022-04-04 13:35:20','오랜만에 영등포 역사와 같이 있는 롯데백화점에 다녀왔다.\n새로이 단장해서 인지 독특한 매장들이 많이 들어와 있었다.\n재방문의사 있음',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/f2551c99-6f40-458d-b839-21057368def6%EA%B2%9F%EB%8E%83%EC%83%B71.jpg',183,1),(755,'2022-04-04 13:36:07','2022-04-04 13:36:07','오랜만에 가본 롯데백화점영등포점 1층이 완전히 요즘트랜드에 맞게 바뀌었네요 Get that s