21-08-26.jpg',261,58),(904,'2022-04-04 17:48:03','2022-04-04 17:48:03','이 역사깊은 공원은, 아기자기하면서 울창한 나무들이 많아 많은 이들의 도심속 휴식처로 사랑을 받고 있는곳이다. 하지만, 공원내에서 개와 함께 산책하는 이들과 자전거로 운동하는 이들의 주의가 요구된다. 다른 사람에게 실례가 되는 행동들을 자제하고 애견의 위생과 배변처리등을 철저히 관리하였으면 하고 바란다.',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/7cea8668-5ec3-4484-afe7-d51f07e87f7f2021-09-22.jpg',261,59),(905,'2022-04-04 17:48:29','2022-04-04 17:48:29','날씨가 풀리니 정말 많은 사람들이 공원에 나와 있어요. 산책하기에 아주 좋은 공원입니다. 넓은 운동장이 맘에 드네요. 매점이 있고 매점뒤에 화장실이 붙어 있어요. 화장실벽 바둑판 타일이 갑자기 3D로 보이네요.',3,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/b5f96cb0-9412-4ab8-80a5-466056341d1dimages%20%284%29.jpg',261,60),(906,'2022-04-04 17:48:49','2022-04-04 17:48:49','운동하기 똭!!운동장 열 바뀌돌면 살 빠질것 같음 . 작은 체육시설도 있고 벤치 편의점 베드민턴장 그 위엔 공군공원 벚꽃 많고 적절히 갈 곳 없으면 여기가서 운동장 돌면 시간 가고 이야기 하기 좋타 ㅋㅋㅋ',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/abf80a9e-3993-4f8b-be5a-16232d79408d2021-04-21.jpg',261,61),(907,'2022-04-04 17:49:06','2022-04-04 17:49:06','관리가 잘되고 있는 도심속 공원입니다.\n공중화장실도 있고 시설이 잘 되어 있는편입니다.',4,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/ce310a01-ab74-4a31-aa0e-9af44f2924f82021-04-21%20%281%29.jpg',261,62),(908,'2022-04-04 17:49:25','2022-04-04 17:49:25','잔디축구장둘레에 걷기운동할 만한 넓은 공원이 있으며 숲도 우거져 있고, 나무 벤치와 식탁이 많은 공원이라 시민들이 쉬기 좋은 곳이다.',4,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/5d7e7589-af93-485b-b2fc-b3b4ef4f7cc72020-03-11.jpg',261,63),(909,'2022-04-04 17:55:29','2022-04-04 17:55:29','3가지 고기 다 맛잇는데 하루하루 가서 한가지씩 먹는게\n나을듯 고기맛이 기억이 안남ㅋㅋ\n오랫만에 숯불에 먹는고기 굿뜨\n상추도 푸짐하고 파절이도 기본반찬도 깔끔하니 좋아요\n아쉬운거는 콩나물된장국인가? 애매한맛 된장국도 아니고 콩나물국도 아니고..',4,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/de1337f9-cb7f-47fb-81bd-3c9595d4ee2f%EB%8B%A4%EC%9A%B4%EB%A1%9C%EB%93%9C%20%285%29.jpg',262,1),(910,'2022-04-04 18:05:10','2022-04-04 18:05:10','피자는 진짜 맛있네요 :) 다른 파스타들은 그냥 쏘쏘했습니다 개인적으로 샐러드 파스타는 제 입맛이 아니라 ㅠ 좋아하실만한 분들은 분명 있을 것 같네요',3,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/7723a5fc