양한 종류의 물고기 파충류들과 어항도 잘보이게 디스플레이도 잘한거 같고요.\n사진 촬영하기도 좋고 특히 인어공주쇼는\n화면과 스피커 통해 나오는 상황에 연기를\n잘해서 아이들이 너무 좋아하는거 같아요.',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/06eed0bf-0b03-4172-9699-da5cddacd82f%EB%8B%A4%EC%9A%B4%EB%A1%9C%EB%93%9C%20%2830%29.jpg',270,87),(942,'2022-04-04 18:55:36','2022-04-04 18:55:36','옥토넛과 콜라보를 하고있는 아쿠아리움, 인어공주님이 아이들과 함께해주는게 좋아요. 크지는 않지만 유아자녀들 데리고가면 좋을것같아요. 롯데타워와 같은 아쿠아리움 다니신 가족들은 부족하다고 느낄것같아요.',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/c18250be-d640-4c33-84a9-3de812319a46%EB%8B%A4%EC%9A%B4%EB%A1%9C%EB%93%9C%20%2831%29.jpg',270,88),(943,'2022-04-04 18:56:12','2022-04-04 18:56:12','한화 아쿠아플라넷 63(Hanhwa Aqua Planet 63)은 대한민국 서울특별시 영등포구 63빌딩 지하 1층에 있는 수족관이다. 예전 이름은 63씨월드였다. 1985년 7월 27일 개관하였다. 총 1078평 규모에 400여종, 2만여마리의 해양생물을 보유하고 있다. 펭귄, 전기뱀장어, 피라니아, 곰치, 수달, 철갑둥어, 악어, 물총고기 등을 보유하고 있으며, 실러캔스도 박제로 전시하고 있다.',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/801782d0-9fe9-4b8e-9e6c-f587db684b2c%EB%8B%A4%EC%9A%B4%EB%A1%9C%EB%93%9C%20%2832%29.jpg',270,25),(944,'2022-04-04 18:56:29','2022-04-04 18:56:29','커여운 수달찡',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/25e19d42-6bec-4459-b870-fb791d3a94e9%EB%8B%A4%EC%9A%B4%EB%A1%9C%EB%93%9C%20%2833%29.jpg',270,26),(945,'2022-04-04 18:56:58','2022-04-04 18:56:58','서울 3대 아쿠아리움 중 인어공주 쇼를 가장 자주하고 재밌게 하는 곳, 코엑스, 롯데월드몰 아쿠아리움에 비하면 규모나 시설면은 다소 아쉽지만 특이하고 다양한 4만여 종의 해양 생물들을 만날 수 있어 좋았습니다.',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/b126f57e-d47a-4ac4-8566-f260479b7464%EB%8B%A4%EC%9A%B4%EB%A1%9C%EB%93%9C%20%2834%29.jpg',270,27),(946,'2022-04-04 18:57:24','2022-04-04 18:57:24','아쿠아리움 규모가 생각보다 크지 않다.\n63빌딩에 이거 하나만 관람하러 가기엔 아쉽다. 전망대 및 전시관람 포함된 패키지권을 추천.',5,'https://wooagong.s3.ap-northeast-2.amazonaws.com/static/feed/b546feca-763d-4ea2-8f57-52113c46c518%EB%8B%A4%EC%9A%B4%EB%A1%9C%EB%93%9C%20%2835%29.jpg',270,28),(947,'2022-04-04 19:00:57','2022-04-04 19:00:57','간판이 없어서 찾아가기 ㅅ힘들어요..',4,'https://wooagong.s3.ap-northeast-2.amazonaws.com/stat